data = ""

tents_distribution = data * 1000

masters = "ABC"
distance = 1000

total = 0

# Complexidade estÃ¡ alta
for i in range(len(tents_distribution)):
    percent = (i * 100) // len(tents_distribution)
    print(f"\rProgresso: {percent}% [{i}/{len(tents_distribution)}]", end="", flush=True)
    if tents_distribution[i] in masters:
        left = i - distance if i - distance >= 0 else 0
        right = i + distance + 1 if i + distance + 1 <= len(tents_distribution) else len(tents_distribution)
        total += tents_distribution[left:right].count(tents_distribution[i].lower())

# Output must be 1666793456
print("\nTotal: " + total)